import React from 'react';


  export default function List(props) {
       console.log(props.list);
      const lista = props.list;
    return (
        <div>
          <h2>List</h2>
          {lista.map((item) => (
        <tr key={item.key}>
          {Object.values(item).map((val) => (
            <td>{val}</td>
          ))}
        </tr>
      ))}
        </div>
    );
}
